parts:
{
  "name": "UBX-NAV-GEOFENCE",
  "description": "Geofencing status",
  "message_class": "0x01",
  "message_id": "0x39",
  "message_type": "periodic_polled",
  "supported_versions": [
    "18",
    "19",
    "19.1",
    "19.2",
    "20",
    "20.01",
    "20.1",
    "20.2",
    "20.3",
    "22",
    "22.01",
    "23",
    "23.01"
  ],
  "payload_length": {
    "variable": {
      "base": 8,
      "formula": "8 + 2*numFences"
    }
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "name": "version",
      "data_type": "U1",
      "fixed_value": 0,
      "description": "Message version (0x00 for this version)"
    },
    {
      "byte_offset": 5,
      "name": "status",
      "data_type": "U1",
      "description": "Geofencing status",
      "value_mapping": {
        "0": "Geofencing not available or not reliable",
        "1": "Geofencing active"
      }
    },
    {
      "byte_offset": 6,
      "name": "numFences",
      "data_type": "U1",
      "description": "Number of geofences"
    },
    {
      "byte_offset": 7,
      "name": "combState",
      "data_type": "U1",
      "description": "Combined (logical OR) state of all geofences",
      "value_mapping": {
        "0": "Unknown",
        "1": "Inside",
        "2": "Outside"
      }
    },
    {
      "byte_offset": 8,
      "name": "geofences",
      "count_field": "numFences",
      "array_of_fields": [
        {
          "name": "state",
          "data_type": "U1",
          "description": "Geofence state",
          "value_mapping": {
            "0": "Unknown",
            "1": "Inside",
            "2": "Outside"
          }
        },
        {
          "name": "id",
          "data_type": "U1",
          "description": "Geofence ID (0 = not available)"
        }
      ]
    }
  ]
}
